import PortalAdvance from "./PortalAdvance";

const ModalBase = ({ visible, onClose, children,  }) => {
  return (
    <>
      <PortalAdvance visible={visible} onClose={onClose}>
        {children}
      </PortalAdvance>
    </>
  );
};

export default ModalBase;
